PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?member ?party WHERE {
  { 
    ?member dbo:party dbr:Democratic-Republican_Party .
    BIND("Democratic-Republican Party" AS ?party)
  }
  UNION
  { 
    ?member dbo:party dbr:Federalist_Party .
    BIND("Federalist Party" AS ?party)
  }
}

```sparql
SELECT ?grandchild WHERE {
  <http://dbpedia.org/resource/Emperor_Toba> dbo:child ?child .
  ?child dbo:child ?grandchild .
}
```

