```sparql
SELECT ?person ?personLabel WHERE {
  ?person dbo:award dbr:Volunteer_Decoration .
  ?person dbo:militaryBranch dbr:New_Guinea_campaign .
  ?person dbo:award dbr:Medal_bar .
  SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
}
```

```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>
PREFIX res: <http://dbpedia.org/resource/>

SELECT ?birthplace ?club
WHERE {
  ?manager a dbo:SportsManager ;
           dbo:team res:Kedah_FA ;
           dbo:birthPlace ?birthplace ;
           dbo:team ?club .
  FILTER (regex(str(?birthplace), "Brazil", "i") && regex(str(?birthplace), "town", "i"))
}
```

